static from<OC extends CronOnCompleteCommand | null = null, C = null>(

	params: CronJobParams<OC, C>

) {

	// runtime check for JS users

	// eslint-disable-next-line @typescript-eslint/no-unnecessary-condition

	if (params.timeZone != null && params.utcOffset != null) {

		throw new ExclusiveParametersError('timeZone', 'utcOffset');

	}



	if (params.timeZone != null) {

		return new CronJob<OC, C>(

			params.cronTime,

			params.onTick,

			params.onComplete,

			params.start,

			params.timeZone,

			params.context,

			params.runOnInit,

			params.utcOffset,

			params.unrefTimeout

		);

	} else if (params.utcOffset != null) {

		return new CronJob<OC, C>(

			params.cronTime,

			params.onTick,

			params.onComplete,

			params.start,

			null,

			params.context,

			params.runOnInit,

			params.utcOffset,

			params.unrefTimeout

		);

	} else {

		return new CronJob<OC, C>(

			params.cronTime,

			params.onTick,

			params.onComplete,

			params.start,

			params.timeZone,

			params.context,

			params.runOnInit,

			params.utcOffset,

			params.unrefTimeout

		);

	}

}
